// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Torrents {
    struct File {
        string name;
        uint256 size;
        string hash;
        address owner;
        
    }


    mapping(uint256 => File) public files;
    uint256 public fileId;
    struct Torrentmapfiles{
   
        string hash;
        string torrentmaphash;
    }

    event FileUploaded(uint256 id, string name, uint256 size, string hash, address owner);

    function uploadFile(string memory _name, uint256 _size, string memory _hash) public {
        files[fileId] = File(_name, _size, _hash, msg.sender);
        emit FileUploaded(fileId, _name, _size, _hash, msg.sender);
        fileId++;
    }

    function getFile(uint256 id) public view returns (string memory name, uint256 size, string memory hash, address owner) {
        File memory file = files[id];
        return (file.name, file.size, file.hash, file.owner);
    }

    function getFilesCount() public view returns (uint256) {
        return fileId;
    }

    function getSeeders(string memory _hash) public view returns (address[] memory) {
        uint256 seederCount;
        for (uint256 i = 0; i < fileId; i++) {
            if (keccak256(bytes(files[i].hash)) == keccak256(bytes(_hash))) {
                seederCount++;
            }
        }
        address[] memory seeders = new address[](seederCount);
        uint256 index = 0;
        for (uint256 i = 0; i < fileId; i++) {
            if (keccak256(bytes(files[i].hash)) == keccak256(bytes(_hash))) {
                seeders[index] = files[i].owner;
                index++;
            }
        }
        return seeders;
    }

    function getSeederCount(string memory _hash) public view returns (uint256) {
        uint256 seederCount;
        for (uint256 i = 0; i < fileId; i++) {
            if (keccak256(bytes(files[i].hash)) == keccak256(bytes(_hash))) {
                seederCount++;
            }
        }
        return seederCount;
    }
    mapping(string => Torrentmapfiles) public torrentmapfiles;
    uint256 public torrentmapfileId;
    event TorrentmapFileUploaded(string hash, string torrentmaphash);

    function uploadTorrentmapFile(string memory _hash, string memory _torrentmaphash) public {
        torrentmapfiles[_hash] = Torrentmapfiles(_hash, _torrentmaphash);
        emit TorrentmapFileUploaded(_hash, _torrentmaphash);
        torrentmapfileId++;
    }

    function getTorrentMap(string memory _hash) public view returns (string memory torrentmaphash) {
        Torrentmapfiles memory torrentmapfile = torrentmapfiles[_hash];
        return (torrentmapfile.torrentmaphash);
    }

}
